  return (
    <div>
      <Header />
      <div className="row mt-3 gy-5 pb-5">
        {listAnnonce.length === 0 ? (
          <h3 className="text-center p-5 border-top">
            Cr√©er votre premiere annonce !
          </h3>
        ) : (
          listAnnonce.map((annonce) => {
            return <Card key={annonce._id} annonce={annonce} />;
          })
        )}
      </div>
    </div>
  );
}
